import React from 'react';
import './SideDrawer.css';
import ReactDOM from 'react-dom';

const SideDrawer = ({ children }) => {
  const content = <aside className='side-drawer'>{children}</aside>;

  const drawerHookElement = document.getElementById('drawer-hook');

  if (!drawerHookElement) {
    console.error('Drawer hook element not found!');
    return null;
  }

  return ReactDOM.createPortal(content, drawerHookElement);
}

export default SideDrawer;
